Target Group:
Applicants with a first professionally qualifying certificate of academic degree in a Geoscience subject/degree course with a total of at least 24 credit points in Geoscience, Earth Sciences, Mineralogy, Geology, Geophysics and a total of 36 credit points from courses in the disciplines Mathematics, Chemistry and Physics, whereby each of the last three disciplines must contribute at least 6 credit points;
English language proficiency of at least level B2 of the Common European Framework of Reference for Languages (CEFR);
Applicants who are not German must demonstrate sufficient German language proficiency corresponding with level A2 (CEFR).

